return ['domain'=>NULL,'plural-forms'=>'nplurals=2; plural=(n != 1);','language'=>'es_ES','pot-creation-date'=>'2025-06-07 16:23+0200','po-revision-date'=>'2025-06-07 16:23+0200','translation-revision-date'=>'2025-06-07 16:23+0200','project-id-version'=>'WooCommerce Redsys Gateway Light','x-generator'=>'Poedit 3.6','messages'=>['Here'=>'Aquí','Welcome to WooCommerce Redsys %s'=>'Bienvenido a WooCommerce Redsys %s','Thank you for install the latest version! WooCommerce Redsys Gateway light, democratizing ecommerce.'=>'¡Gracias por instalar la última versión! WooCommerce Redsys Gateway light, democratizando el ecommerce.','Version %s'=>'Versión %s','What&#8217;s New'=>'Qué hay nuevo','The official WooCommerce.com extension'=>'La extensión oficial de WooCommerce.com','Please, test the plugin, and if you are happy with it, consider to make a '=>'Por favor, prueba el plugin, y si estás contento con él, considera realizar un ','This gateway is the light version of official WooCommerce Redsys plugin at WooCommerce.com'=>'Esta pasarela es la versión light de la extensión oficial de Redsys en WooCommerce.com','This WooCommerce extension has all you need for start selling through Redsys. It is full compatible with WPML. If you need more power, you can buy the premium extension at %s.'=>'Esta extensión de WooCommerce tiene todo lo que necesitas para comenzar a vender a través de Redsys. Es totalmente compatible con WPML. Si necesitas más cosas, puedes adquirir la versión premium en %s.','With the premium version you get many important features like tokenization, refund, two terminals, error actions, Sequential Invoice Number, invoice export, etc. See all features %s'=>'Con la versión premium adquieres muchas características importantes como el pago con referencia (pago con 1 clic), reembolso, dos terminales, acciones frente a errores, números secuenciales de facturas, exportación de facturas, etc. Mira todas las características %s','Get the pro version at WooCommerce.com'=>'Consigue la versión premian en WooCommerce.com','Features of light version'=>'Características de la versión light','Select a Language'=>'Selecciona un idioma','Select the Redsys Gateway Language from settings. You can select the Redsys Gateway language from settings, so if you have several shops, you can select a different language for each one.'=>'Selecciona el idioma de la pasarela de Redsys desde las configuración. Puedes seleccionar el idioma de la pasarela desde la configuración, así que si tienes diferentes tiendas, puedes seleccionar un idioma para cada una.','WMPL Ready'=>'Preparado para WPML','This extension is WPML ready. If you use WPML, Redsys Gateway will be shown in the customer language, don&#8217;t lose orders because the customer don&#8217;t understand the predefined language gateway. If you use WPML, the language selection in settings is not needed'=>'Esta extensión está preparada para WPML. Si utilizas WPML, la pasarela Redsys se mostrará en el idioma del cliente, no pierdas pedidos porque no entiendan el idioma predefinido. Si utilizas WPML la selección de idioma en la configuración no es necesaria','SNI Compatibility'=>'Compatibilidad con SNI','This extension is SNI Ready, so will work with Let&#8217;s Encrypt certificate. Without SNI Compatibility, you orders will not market as paid after customer pais at Redsys because Redsys will not be able to communicate with your website.'=>'Esta extensión está preparada para SNI, así que funcionará con certificados como Let&#8217;s Encrypt. Sin la compatibilidad SNI, tus pedidos no se marcarán como pagados después de que tus clientes paguen en Redsys, ya que Redsys no será capaz de comunicarse con tu sitio.','Always compatible'=>'Siempre compatible','Because this is the official WooCommerce Extension, always will be compatible with the latest WooCommerce version. All official extension are constantly audited by WooCommerce team ensuring compatibility with the latest WooCommerce version'=>'Ya que esta extensión es una extensión oficial de WooCommerce, siempre será compatible con la última versión. Todas las versiones oficiales son constantemente auditadas por el equipo de WooCommerce asegurándose la compatibilidad con la última versión de WooCommerce','Features of Premium Version'=>'Características de la versión premium','Refund from Order'=>'Reembolso desde el pedido','With Refund, you can refund an Order from admin, you dont need to go to Redsys.'=>'Con reembolso, puedes reembolsar los pedidos desde la administración, no necesitas ir a Redsys.','Tokenization'=>'Tokenización (pago con referencia)','With Tokenization, your customers can Pay with one click, after first order'=>'Con la tokenización (pago con referencia), tus clientes pueden pagar con un clic después del primer pedido','Video demostration'=>'Demostración en vídeo','You can watch premium features in action in this video. If you watch this video, you can evaluate the features of the premium version and in this way, assess if you are interested. After viewing it, you can evaluate if you are interested in buying it.'=>'Puedes ver todas las características premium en acción en este video. Si ves el video, podrás valorar las características de la versión premium, y de este modo, decidir si te interesa. Después de verlo, decide si la adquieres.','Second terminal'=>'Segundo terminal','With the Second terminal, you can add a security check for expensive orders, and a direct pay (without security check) for cheapest orders.'=>'Con el segundo terminal puedes añadir seguridad a los pedidos caros, y un pago directo (sin comprobación de seguridad) para los pedidos más económicos.','With two terminals you can have the right balance between security and risk. You will not lose orders on cheap purchases, and you will protect yourself from expensive order frauds'=>'Con dos terminales puedes tener el equilibrio adecuado entre seguridad y riesgo. No perderás pedidos en compras de bajo coste, y estarás protegido frente a fraudes en los pedidos de alto precio','Sequential Invoice Number'=>'Número secuencial de facturas','Get Sequential Invoice Number with the Pro version. Sequential Invoice Number is mandatory for Spain.'=>'Consigue el número secuencial de factura con la versión premium. El número secuencial de factura es obligatorio en España.','With the Pro version, you will get Sequential Invoice Number so all your payed orders will have a sequential number, complying with the Spanish public finances.'=>'Con la versión premium, conseguirás el número secuencial de facturas, para que todos tus pedidos pagados tengan un número secuencial, cumpliendo con la Hacienda pública española.','Select error action'=>'Selecciona la acción frente a error','With the select error action, you can set what happen when a customer make an error typing his credit card.'=>'Con la selección de la acción en error, podrás configurar que sucede cuando un cliente comete un error al introducir su tarjeta de crédito.','By default, the order is cancelled, but with this option you can redirect the customer to the checkout page without cancelling the order, so You get a new opportunity for get a conversion!.'=>'Por defecto, los pedidos son cancelados, pero con esta opción podrás redireccionar a tus clientes a la página de pago sin cancelar el pedido, ¡así que obtendrás una nueva oportunidad de conseguir una conversión!','Export Orders to CSV'=>'Exportar pedidos a CSV','Export Orders to CSV for has all needed data. With this feature, you can easily get all the data you need.'=>'Exportación de pedidos a CSV para todos los datos necesarios. Con esta características, podrás de una forma sencilla conseguir todos los datos que necesitas.','With Export Orders to CSV, you will download a CSV with all your orders between two dates, so you will be able to import that CSV to your contatibility software or in an Excel or similar to Excel.'=>'Con la exportación de pedidos a CSV, descargarás un CSV con todos tus pedidos entre dos fechas, así que serás capaz de importar el CSV a tu software de contabilidad o a un Excel o similar.','Bizum Lite (by José Conti)'=>'Bizum Lite (por José Conti)','Bizum Lite  works redirecting customers to Bizum.'=>'Bizum Lite funciona redirigiendo a los clientes a Bizum.','Bizum'=>'Bizum','Bizum works by sending the user to Bizum Gateway'=>'Bizum funciona enviando al usuario a la pasarela Bizum','Check <a href="%1$s" target="_blank" rel="noopener">FAQ page</a> for working problems, or open a <a href="%2$s" target="_blank" rel="noopener">thread on WordPress.org</a> for support. Please, add a <a href="%3$s" target="_blank" rel="noopener">review on WordPress.org</a>'=>'Consulta la <a href="%1$s" target="_blank" rel="noopener">página de preguntas frecuentes</a> si tienes problemas de funcionamiento, o abre un <a href="%2$s" target="_blank" rel="noopener">hilo en WordPress.org</a> para obtener ayuda. Por favor, añade una <a href="%3$s" target="_blank" rel="noopener">reseña en WordPress.org</a>','Servired/RedSys works by sending the user to your bank TPV to enter their payment information.'=>'La pasarela Servired/RedSys envía a tu cliente al TPV de su entidad bancaria para ingresar su información para el pago.','Attention! WPML detected.'=>'¡Atención! detectado WPML.','The Gateway will be shown in the customer language. The option "Language Gateway" is not taken into consideration'=>'La pasarela de pago se mostrará en el idioma del cliente. La opción «Idioma de la pasarela» no se tendrá en cuenta','Gateway Disabled'=>'Pasarela desactivada','Servired/RedSys only support EUROS &euro; and BRL currency.'=>'Servired/RedSys en estos momentos solo es compatible con las monedas EURO &euro; y BRL.','Enable/Disable'=>'Activar/Desactivar','Enable Bizum'=>'Activar Bizum','Title'=>'Título','This controls the title which the user sees during checkout.'=>'Esto controla el título que el cliente ve al finalizar la compra.','Description'=>'Descripción','This controls the description which the user sees during checkout.'=>'Esto controla la descripción que el cliente ve al finalizar la compra.','Pay via Bizum you can pay with your Bizum account.'=>'Pagando mediante Bizum puedes pagar con tu cuenta Bizum.','Logo'=>'Logotipo','Add link to image logo.'=>'Añadir enlace a la imagen de logotipo.','Commerce number (FUC)'=>'Número de comercio (FUC)','Commerce number (FUC) provided by your bank.'=>'Número de comercio (FUC) facilitado por tu entidad bancaria.','Commerce Name'=>'Nombre de comercio','Terminal number'=>'Número de terminal','Terminal number provided by your bank.'=>'Número de terminal facilitado por tu entidad bancaria.','What to do after payment?'=>'¿Qué hacer después del pago?','Chose what to do after the customer pay the order.'=>'Selecciona que deseas hacer después de que el cliente pague el pedido.','Mark as Processing (default & recomended)'=>'Marcar como procesando (por defecto y recomendado)','Mark as Complete'=>'Marcar como completado','Transaction Limit'=>'Límite de transacción','Maximum transaction price for the cart.'=>'Máximo precio de transacción en el carrito.','HTTPS SNI Compatibility'=>'Compatibilidad HTTPS SNI','Activate SNI Compatibility.'=>'Activa compatibilidad con certificados SNI.','If you are using HTTPS and Redsys don\'t support your certificate, example Lets Encrypt, you can deactivate HTTPS notifications. WARNING: If you are forcing redirection to HTTPS with htaccess, you need to add an exception for notification URL'=>'Si estás usando HTTPS y Redsys no es compatible con tu certificado, por ejemplo Let’s Encrypt, debes activar esta función. ATENCIÓN: Si estás forzando la redirección a HTTPS mediante htaccess (si usas Really Simple SSL seguro que lo haces), necesitas añadir una excepción para que no redirija la URL de notificación','Encryption secret passphrase SHA-256'=>'Clave secreta de cifrado SHA256','Encryption secret passphrase SHA-256 provided by your bank.'=>'Clave secreta de cifrado SHA256 facilitada por tu banco.